import Head from 'next/head';

const Layout = (props) => {
    return ( < div >

        <
        Head >
        <
        title > APP Merca en Linea < /title> <
        link rel = "stylesheet"
        href = "https://bootswatch.com/4/flatly/bootstrap.min.css" / >
        <
        /Head> {
        props.children
    } < / div>);
};

export default Layout;
